import { Link } from "react-router-dom";

function Nav(){
    return(
        <nav>
            <Link to=""></Link>
            <Link to="">Services</Link>
            <Link to="">Work</Link>
            <Link to="">About</Link>
            <Link to="">Contact</Link>
        </nav>
    );
}

export default Nav;
